description: >-
  Tradiční párty, kterou pořádáme 1x za měsíc.

  Těšíme se na vás všechny přátelé z MB, LBC, JBC, HK.... a další. S lítostí i radostí musíme oznámit, že tentokrát musíme na skok zpět do našeho legendárního výměníku ❤ Kdo to nezažil, máte jedinečnou možnost 🤣😇❤💃 Vlastní občerstvení a náhradní tričko sebou! 😉🙏 V kulturáku se nám moc líbí (časem ještě zvětšíme parket), ale nejde to, v ten termín tam je erotický ples!🤭 Jo a návrhy, jakože by to šlo a za jakých podmínek už slyším 🤣 .... nenene, hezky oblečení a potit se a družit se na baru v našem milovaném výměníku 😜😎💃🪇👍🤣❤💃🕺Celý večer vás bude provázet báječný DJ Lole ❤
